import React from 'react';
import './shop.css';

class Shop extends React.Component{
	render(){
		return(
			<div>
				<div className="only">
					<div className="top">豆瓣&nbsp;豆品</div>
					<div className="bigchecked">
						<input type="checkbox"></input>
						<span>豆瓣豆品</span>
					</div>
					<hr />
					<div className="goods">
						<div className="good">
							<input></input>
							<img src="https://img3.doubanio.com/view/dianpu_product_item/small/public/p2049830.jpg" />
							
							<div>豆瓣丝巾上的美术馆</div>
							<span>马蒂斯款</span>
							<i>-</i>
							<span></span>
							<i>+</i>
						</div>
					</div>
				</div>
			</div>
		)
	}
}

export default Shop;
